('Apple Airpods Pro', 'airpods-pro', 'in-ear', '\r\n<ul class=\"description\">\r\n    <li>Active noise cancellation for immersive sound</li>\r\n    <li>Transparency mode for hearing and connecting with the world around you</li>\r\n    <li>Three sizes of soft, tapered silicone tips for a customizable fit</li>\r\n    <li>Sweat and water resistant</li>\r\n    <li>Adaptive EQ automatically tunes music to the shape of your ear</li>\r\n    <li>Easy setup for all your Apple devices</li>\r\n    <li>Quick access to Siri by saying Hey Siri</li>\r\n    <li>The Wireless Charging Case delivers more than 24 hours of battery life</li>\r\n    </ul>\r\n    ', '249.00', );
INSERT INTO `itemData` (`itemName`, `itemID`, `itemClass`, `itemDescription`, `itemPrice`, `itemImage`) VALUES
('Apple Airpods', 'airpods', 'in-ear', '\r\nAutomatically on, automatically connected.\r\n        Easy setup for all your Apple devices.\r\n        Quick access to Siri by saying Hey Siri.\r\n        Double-tap to play or skip forward.\r\n        New Apple H1 headphone chip delivers faster wireless connection to your devices.\r\n        Charges quickly in the case.\r\n        Case can be charged using the Lightning connector', '159.00', );
INSERT INTO `itemData` (`itemName`, `itemID`, `itemClass`, `itemDescription`, `itemPrice`, `itemImage`) VALUES
('Beats Solo 3', 'beats-solo-3', 'on-ear', '\r\n<ul class=\"description\">\r\n        <li>High-performance wireless Bluetooth headphones</li>\r\n        <li> Features the Apple W1 chip and Class 1 wireless Bluetooth connectivity</li>\r\n        <li> With up to 40 hours of battery life, Beats Solo3 wireless is your perfect everyday headphone</li>\r\n        <li>Compatible with iOS and Android devices</li>\r\n        <li>With Fast Fuel, 5 minutes of charging gives you 3 hours of playback when battery is low</li>\r\n        <li>Adjustable fit with comfort-cushioned ear cups made for everyday use</li>\r\n        <li>Sleek, streamlined design that is durable and foldable to go everywhere you do</li>\r\n    </ul>', '199.95', );
INSERT INTO `itemData` (`itemName`, `itemID`, `itemClass`, `itemDescription`, `itemPrice`, `itemImage`) VALUES
('Beats Solo Pro', 'beats-solo-pro', 'over-ear', '\r\n    High-performance wireless noise cancelling headphones in ivory.\r\n    Active Noise Cancelling (ANC) blocks external noise.\r\n    Transparency helps you stay aware of your surroundings while listening.\r\n    Features the Apple H1 Headphone Chip and Class 1 Bluetooth for extended range and fewer dropouts.\r\n    Compatible with iOS and Android.\r\n    Hands-free controls via Hey Siri on iOS devices, and voice capability with the push of the b button on a variety of compatible devices.\r\n    Up to 22 hours of listening time (up to 40 hours with ANC and Transparency turned off).', '299.95', );
INSERT INTO `itemData` (`itemName`, `itemID`, `itemClass`, `itemDescription`, `itemPrice`, `itemImage`) VALUES
('Beats Studio 3', 'beats-studio-3', 'over-ear', 'High-performance wireless noise cancelling headphones.\r\nCompatible with iOS and Android devices.\r\nPure adaptive noise canceling (pure ANC) actively blocks external noise.\r\nReal-time Audio calibration preserves a Premium listening experience.\r\nUp to 22 hours of battery life enables full-featured all-day wireless playback.\r\nApple W1 chip and industry-leading Bluetooth technology keep you connected farther with fewer drop-outs.\r\nWith fast Fuel, a 10-minute charge gives 3 hours of play when battery is low. Rechargeable lithium ion battery.', '349.95', );
INSERT INTO `itemData` (`itemName`, `itemID`, `itemClass`, `itemDescription`, `itemPrice`, `itemImage`) VALUES
('Beats X', 'beatsx', 'in-ear', 'Connect via Class 1 Bluetooth with your device for wireless listening.\r\nUp to 8 hours of battery life for when you are on the go.\r\nWith Fast Fuel, a 5-minute charge gives you 2 hours of playback when battery is low.\r\nTake calls, control your music and activate Siri with RemoteTalk.\r\nWhat is in the Box: Beatsx earphones, eartips with four (4) size options, removable secure-fit wingtips, pocket-sized carrying case, lightning to USB-A charging cable, Quick Start Guide, warranty card', '99.95', );
INSERT INTO `itemData` (`itemName`, `itemID`, `itemClass`, `itemDescription`, `itemPrice`, `itemImage`) VALUES
('Samsung Galaxy Buds +', 'galaxybuds', 'in-ear', 'Exactly what you want to hear. Galaxy Buds+ are the perfect fitting earbuds to isolate you from distracting noises, so you can stay focused on what you want. And if youd like to filter in some of the outside world to be more in-tune with your surroundings, you can switch on Ambient Aware2. Hear flight announcements, oncoming traffic or your order number while still enjoying your favorite playlist or podcast.\r\n22 hours of serious sound. Get up to 11 hours of nonstop music on a single charge, then pop your Galaxy Buds+ in the wireless charging case and get nearly 11 more. Forgot to charge them the night before? No worries. ?3 minutes of charging gives you one hour of play time, so you have enough juice for your commute or workout.\r\nYour voice, loud and clear. Ensure youre heard clearly. A dedicated internal and two external microphones pick up your voice and isolate it from outside noises. When youre on a call, your voice comes through richly and confidently, even in noisy locations.\r\nAndroid & iOS compatible. Pair with smart devices via Bluetooth. Use the Galaxy Wearable app on Android and Galaxy Buds+ app on iOS to make the most of your earphones.\r\nIncluded Components: 3 Size Eargel', '129.99', );
INSERT INTO `itemData` (`itemName`, `itemID`, `itemClass`, `itemDescription`, `itemPrice`, `itemImage`) VALUES
('Jaybirds X4', 'jaybirds-x4', 'in-ear', '8 HOURS OF PLAY TIME Rechargeable battery provides 8 hours of bluetooth wireless play time on a 2 hour charge. Wireless range: Class 2 standard range 10m/33ft.\r\nSWEAT & WATERPROOF IPX7 protection for gym and fitness workouts and running in all weather conditions.\r\nSPORT FIT PLUS Comfortable headphone design runs over your ears for a secure sport fit or under for more relaxed situations.\r\nCOMFORTABLE FIT Interchangeable Comply Ultra thermo-reactive tips provide enhanced durability rich sound and conform to individual ear canals for a comfortable secure fit.\r\nPREMIUM SOUND The Jaybird app provides Custom EQ allows athletes to customize sound EQ and save personal settings to the buds.', '129.99', );
INSERT INTO `itemData` (`itemName`, `itemID`, `itemClass`, `itemDescription`, `itemPrice`, `itemImage`) VALUES
('Powerbeats Pro', 'powerbeats-pro', 'in-ear', 'Up to 9 hours of listening time (more than 24 hours with charging case).\r\nAdjustable, secure-fit ear hooks for lightweight comfort and stability.\r\nReinforced design for sweat & water resistance during tough workouts or running.\r\nVolume & track controls on each earbud, voice capability, and auto play/pause.\r\nFeatures the Apple H1 Headphone Chip and Class 1 Bluetooth for extended range and fewer dropouts.\r\nCompatible with iOS and Android.', '249.95', );
INSERT INTO `itemData` (`itemName`, `itemID`, `itemClass`, `itemDescription`, `itemPrice`, `itemImage`) VALUES
